export const gameStatusToString = {
  1: "Red's turn",
  2: "Blue's turn",
  3: 'Red Wins',
  4: 'Blue Wins',
  5: 'Your Turn', // Green
  6: 'You Win', // Green
  7: 'You Lose', // Green
};

export const cardTeamToString = {
  0: 'neutral',
  1: 'red',
  2: 'blue',
  3: 'death',
  4: 'green',
};
